import React, { useState } from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  const [number, setNumber] = useState(5);
  const changeNumber = () => {
    setNumber(2);
  }
  return (
    <div className="App">
      {number}
      <button onClick={changeNumber}>ChangeNumber</button>
    </div>
  );
}

export default App;
